DROP DATABASE IF EXISTS amazon_bestsellers;
CREATE DATABASE amazon_bestsellers CHARACTER SET utf8mb4;
USE amazon_bestsellers;

-- 1) Catálogos / tablas padre

CREATE TABLE mercado (
  codigo_mercado CHAR(2) NOT NULL,
  nombre VARCHAR(100) NOT NULL,
  region VARCHAR(100) DEFAULT NULL,
  fecha_creacion TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (codigo_mercado)
);

CREATE TABLE pagina (
  id_pagina TINYINT UNSIGNED NOT NULL,
  descripcion VARCHAR(255) DEFAULT NULL,
  items_por_pagina SMALLINT UNSIGNED DEFAULT 50,
  PRIMARY KEY (id_pagina)
);

CREATE TABLE etiqueta_cambio (
  id_etiqueta TINYINT UNSIGNED NOT NULL,
  etiqueta VARCHAR(50) NOT NULL,
  descripcion TEXT DEFAULT NULL,
  PRIMARY KEY (id_etiqueta)
);

CREATE TABLE moneda (
  codigo_moneda CHAR(5) NOT NULL,
  descripcion VARCHAR(100) DEFAULT NULL,
  PRIMARY KEY (codigo_moneda)
);

CREATE TABLE categoria (
  codigo_categoria VARCHAR(50) NOT NULL,
  nombre_categoria VARCHAR(255) DEFAULT NULL,
  descripcion TEXT DEFAULT NULL,
  PRIMARY KEY (codigo_categoria)
);



-- Insertar categorías base


-- 2) Entidad principal: producto (ASIN -> codigo_producto)

CREATE TABLE producto (
  codigo_producto VARCHAR(20) NOT NULL,   -- ASIN
  nombre VARCHAR(1000) NOT NULL,
  codigo_categoria VARCHAR(50) DEFAULT NULL,
  url_producto VARCHAR(1000) DEFAULT NULL,
  fecha_alta TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (codigo_producto),
  FOREIGN KEY (codigo_categoria) REFERENCES categoria (codigo_categoria)
);

-- 3) Foto(s) del producto (1:N)

CREATE TABLE foto_producto (
  id_foto INT NOT NULL AUTO_INCREMENT,
  codigo_producto VARCHAR(20) NOT NULL,
  url_foto VARCHAR(1000) NOT NULL,
  texto_alt VARCHAR(255) DEFAULT NULL,
  orden SMALLINT UNSIGNED DEFAULT 1,
  fecha_insert TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (id_foto),
  FOREIGN KEY (codigo_producto) REFERENCES producto (codigo_producto)
);

-- 4) Histórico de precios y valoraciones

CREATE TABLE precio_historico (
  id_precio INT NOT NULL AUTO_INCREMENT,
  codigo_producto VARCHAR(20) NOT NULL,
  codigo_mercado CHAR(2) NOT NULL,
  fecha_valor DATE NOT NULL,
  precio NUMERIC(15,4) NOT NULL,
  codigo_moneda CHAR(5) DEFAULT NULL,
  fuente VARCHAR(255) DEFAULT NULL,
  PRIMARY KEY (id_precio),
  FOREIGN KEY (codigo_producto) REFERENCES producto (codigo_producto),
  FOREIGN KEY (codigo_mercado) REFERENCES mercado (codigo_mercado),
  FOREIGN KEY (codigo_moneda) REFERENCES moneda (codigo_moneda)
);

CREATE TABLE valoracion_historica (
  id_valoracion INT NOT NULL AUTO_INCREMENT,
  codigo_producto VARCHAR(20) NOT NULL,
  codigo_mercado CHAR(2) NOT NULL,
  fecha_valor DATE NOT NULL,
  estrellas DECIMAL(2,1) DEFAULT NULL,
  numero_valoraciones INT DEFAULT NULL,
  fuente VARCHAR(255) DEFAULT NULL,
  PRIMARY KEY (id_valoracion),
  FOREIGN KEY (codigo_producto) REFERENCES producto (codigo_producto),
  FOREIGN KEY (codigo_mercado) REFERENCES mercado (codigo_mercado)
);

-- 5) Clasificación / ranking (tabla central)

CREATE TABLE clasificacion (
  codigo_clasificacion INT NOT NULL AUTO_INCREMENT,
  codigo_producto VARCHAR(20) NOT NULL,
  codigo_mercado CHAR(2) NOT NULL,
  id_pagina TINYINT UNSIGNED DEFAULT NULL,
  fecha_referencia DATE NOT NULL,
  puesto INT NOT NULL,
  precio NUMERIC(15,4) DEFAULT NULL,
  codigo_moneda CHAR(5) DEFAULT NULL,
  valoracion DECIMAL(2,1) DEFAULT NULL,
  numero_valoraciones INT DEFAULT NULL,
  id_etiqueta TINYINT UNSIGNED DEFAULT NULL,
  url_producto VARCHAR(1000) DEFAULT NULL,
  fuente VARCHAR(255) DEFAULT NULL,
  fecha_import TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (codigo_clasificacion),
  FOREIGN KEY (codigo_producto) REFERENCES producto (codigo_producto),
  FOREIGN KEY (codigo_mercado) REFERENCES mercado (codigo_mercado),
  FOREIGN KEY (id_pagina) REFERENCES pagina (id_pagina),
  FOREIGN KEY (id_etiqueta) REFERENCES etiqueta_cambio (id_etiqueta),
  FOREIGN KEY (codigo_moneda) REFERENCES moneda (codigo_moneda)
);

-- 6) Tabla cruda (raw) con todos los campos EXACTOS del CSV

CREATE TABLE datos_crudos (
  id_registro INT NOT NULL AUTO_INCREMENT,
  rank_original INT NULL,
  asin_raw VARCHAR(20) NULL,
  product_title_raw TEXT NULL,
  product_price_raw VARCHAR(255) NULL,
  product_star_rating_raw VARCHAR(100) NULL,
  product_num_ratings_raw VARCHAR(100) NULL,
  product_url_raw VARCHAR(1000) NULL,
  product_photo_raw VARCHAR(1000) NULL,
  rank_change_label_raw VARCHAR(255) NULL,
  country_raw VARCHAR(10) NULL,
  page_original INT NULL,
  fecha_import TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  fuente VARCHAR(255) DEFAULT 'Amazon_bestsellers_items_2025.csv',
  PRIMARY KEY (id_registro)
);

-- 7) Tablas de administración / metadatos

CREATE TABLE fuente_datos (
  id_fuente INT NOT NULL AUTO_INCREMENT,
  codigo_fuente VARCHAR(100) NOT NULL,
  descripcion TEXT DEFAULT NULL,
  url_origen VARCHAR(1000) DEFAULT NULL,
  fecha_registro TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (id_fuente),
  UNIQUE (codigo_fuente)
);

CREATE TABLE audit_log (
  id_audit BIGINT NOT NULL AUTO_INCREMENT,
  fecha TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
  nivel ENUM('INFO','WARN','ERROR') DEFAULT 'INFO',
  componente VARCHAR(255) DEFAULT NULL,
  mensaje TEXT,
  PRIMARY KEY (id_audit)
);

-- 8) Habilitar carga local
SET GLOBAL local_infile = 1;

